2:Anyside Hand: Suited/Connectors/Draw Hand, Pair, AA, three betting areas, winning to get the bonus of the corresponding multiplier;
Cowboys, bulls hitting the betting area with the same hand, only one hit is counted;
Cowboys, bulls both hitting two betting areas with different hands, both areas counting as hits;

